import React from "react";
import Images from "../../img/img_gallery";

const Gallery = () => {
  const imgUrl = [
    "gift.jpg",
    "inside.jpg",
    "inside_2.jpg",
    "mojito.jpg",
    "steak.jpg",
    "wine.jpg",
  ];

  return (
    <div>
      <a href="https://ibb.co/z5SJhTF">
        <img
          src="https://i.ibb.co/SxKrX4c/Processed-with-VSCO-with-c1-preset.jpg"
          alt="Processed-with-VSCO-with-c1-preset"
          border="0"
          width="250px"
        ></img>
      </a>
    </div>
  );
};

export default Gallery;
